    created_at timestamp with time zone DEFAULT now(),
    updated_at timestamp with time zone DEFAULT now(),
    department_id uuid,
    role_id uuid,
    manager_id uuid,
    avatar_url text,
    external_id text,
    password text,
    onboarding_status text DEFAULT 'not_started'::text
);
ALTER TABLE public.employees OWNER TO postgres;
