DELETE FROM public.tr_role_permissions
WHERE permission_id NOT IN (SELECT id FROM public.permissions);
DELETE FROM public.tr_role_permissions
WHERE role_id NOT IN (SELECT id FROM public.roles);
DELETE FROM public.tr_leaves
WHERE employee_id IS NOT NULL AND employee_id NOT IN (SELECT id FROM public.employees);
UPDATE public.tr_leaves
SET approved_by = NULL
WHERE approved_by IS NOT NULL AND approved_by NOT IN (SELECT id FROM public.employees);
DELETE FROM public.tr_leaves
WHERE leave_type_id IS NOT NULL AND leave_type_id NOT IN (SELECT id FROM public.leave_types);
UPDATE public.employees
SET department_id = NULL
WHERE department_id IS NOT NULL AND department_id NOT IN (SELECT id FROM public.departments);
UPDATE public.employees
SET role_id = NULL
WHERE role_id IS NOT NULL AND role_id NOT IN (SELECT id FROM public.roles);
UPDATE public.employees e1
SET manager_id = NULL
WHERE manager_id IS NOT NULL AND NOT EXISTS (SELECT 1 FROM public.employees e2 WHERE e2.id = e1.manager_id);
